// src/components/Header.js (rename from Header.jsx)
import React from 'react';
import {Link} from 'react-router-dom';
const Header = () => {

  const loggedIn = false;

  return (
    <div></div>
    (!loggedIn && <div>
      <nav className="p-6 flex items-center justify-between">
        <h1 className="text-2xl font-bold">EQUI</h1>
        <div className="flex gap-4">
         <Link to="/login"> <button className="text-gray-600 hover:text-gray-900 px-4 py-2">Login</button></Link>
         <Link to="/signup"> <button className="bg-black text-white px-4 py-2 rounded-lg hover:bg-gray-800">Sign Up</button></Link>
        </div>
      </nav>
    </div>)
    (loggedIn && <div>
      <nav className="p-6 flex items-center justify-between">
        <h1 className="text-2xl font-bold">EQUI</h1>
        <div className="flex gap-4">
         <Link to="/dashboard"> <button className="bg-black text-white px-4 py-2 rounded-lg hover:bg-gray-800">User</button></Link>
        </div>
      </nav>
    </div>)
  );  
};

export default Header;
